import { View, Image } from 'react-native';
import React from 'react';

export default function Header() {
  return (
    <View>
      <View style={{ backgroundColor: '#FFFFFF', height: 96, width: '100%', padding: 30, paddingLeft: 41 }}>
        <Image source={require('../assets/logo.png')} style={{ width: '100%', height: '100%', maxWidth: 278 }} />
      </View>
    </View>
  );
}
